import React from 'react';

const TestButton: React.FC = () => {
  return (
    <div
      style={{
        background: 'rgb(255,0,0)',
        backgroundColor: 'rgb(255,0,0)',
        border: '2px solid black',
        padding: '12px 24px',
        borderRadius: '8px',
        color: 'white',
        display: 'flex',
        alignItems: 'center',
        gap: '8px',
        cursor: 'pointer',
        backdropFilter: 'none',
        WebkitBackdropFilter: 'none',
        position: 'relative',
        zIndex: 1000,
      }}
    >
      TEST BUTTON
    </div>
  );
};

export default TestButton;
